import React from 'react'
import "./servicesList.css"
import Pedi from "../../assets/images/serviceListImages/pedi.jpg"

const servicesList = () => {
  return (
    <div className='sList'>
      <div className='sListItem'>
        <img src={Pedi} alt="pedi" />
      </div>
    </div>
  )
}

export default servicesList
